schema:
{
 "description": "EipSpec defines the desired state of EIP",
 "properties": {
  "address": {
   "pattern": "^([0-9]{1,3}\\.){3}[0-9]{1,3}((\\/([0-9]|[1-2][0-9]|3[0-2]))|(\\-([0-9]{1,3}\\.){3}[0-9]{1,3}))?$",
   "type": "string"
  },
  "disable": {
   "type": "boolean"
  },
  "protocol": {
   "enum": [
    "bgp",
    "layer2"
   ],
   "type": "string"
  },
  "usingKnownIPs": {
   "type": "boolean"
  }
 },
 "required": [
  "address"
 ],
 "title": "Eip",
 "type": "object"
}
